import React from 'react'
//import {Typography} from '@material-ui/core';
//import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField'
import Grid from '@material-ui/core/Grid';
import { useState } from 'react';
import InputMask from 'react-input-mask';


export default function RegisterMember(props){

    
    const [first_name,setfirst_name] = useState('');
    const [last_name,setlast_name] = useState(''); 
    const [Address,setAddress] = useState('');
    const [CNIC, setCNIC] = useState('');
    const [Phone_No,setPhone] = useState('');
    const [DateOfBirth,setDateOfBirth] = useState();
    const [username,setUser] = useState("");
    const [password,setPassword] = useState("");

    
    
    return(
        <div>
        
        <Grid container  direction="column">

            <Grid container >
                <TextField label="First Name" variant="outlined"  value={first_name} onChange={(event)=>{setfirst_name(event.target.value)}}/>
                <TextField label="Last Name" variant="outlined"   value={last_name} onChange={(event)=>{setlast_name(event.target.value)}}/> 
            </Grid>

            <Grid>
                <InputMask mask="99999-9999999-9" maskChar=" " value={CNIC} onChange={(event)=>{setCNIC(event.target.value.replaceAll("-",""))}} >
                    {()=><TextField label="CNIC" variant="outlined" />}
                </InputMask>
            </Grid>

            <Grid>
                <InputMask mask="9999-9999999" maskChar=" " value={Phone_No} onChange={(event)=>{setPhone(event.target.value.replace("-",""))}} >
                    {()=><TextField label="Mobile Number" variant="outlined" />}
                </InputMask>
            </Grid>
            <Grid>
                <TextField label="Address" multiline rows={4} value={Address} onChange={(event)=>{setAddress(event.target.value)}}/>
            </Grid>
        
            <Grid>
                <TextField  label="Date of Birth" type="date" defaultValue="2000-01-01" value={DateOfBirth} onChange={(event)=>{setDateOfBirth(event.target.value)}}/>
            </Grid>
            
                    
        </Grid>
        
        </div>  
    )

};
